*Note:* `updateInput: () => value => { ....` - `value` can now be properly typed by `StateHandlerProps` rather than previous `any` 

```typescript
interface StateProps {
  list: string[];
  input: string;
}
type StateHandlerProps = StateHandlerMap<StateProps> & {
  addToList: () => Partial<StateProps>;
  updateInput: (value: string) => Partial<StateProps>;
};
export const withFormState = withStateHandlers<StateProps, StateHandlerProps>(
  { list: [], input: "" },
  {
    addToList: ({ list, input }) => () => ({
      list: (input.trim() ? [...list, input.trim()] : list).sort(),
      input: ""
    }),
    updateInput: () => value => {
      return { input: value };
    }
  }
);
```
